  \"Fabrication of Radar Array Antennas Using Large-Area, High-Resolution Lithography-on-Flex
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 4,\n\t\t\"recent\": 2\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-06T21:55:26.204601\",\n\t\"name\":
  \"fabrication-of-radar-array-antennas-using-large-area-high-resolution-lithography-on-flex-p\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"As the important role of NASA \"missions
  to earth\" has been clearly demonstrated in recent years, the need for radar antenna
  systems that have large fields of coverage has gained increased emphasis. In order
  to achieve the desired performance from space, the antenna systems must have surface
  areas that are hundreds of square meters in size. However, to make it affordable
  to deploy such large-area antennas into space, it is necessary to fabricate these
  antennas on flexible substrates, which are lightweight, and can be rolled into small
  volumes. The fabrication of flexible antennas calls for new manufacturing techniques
  that are capable of addressing the challenges of patterning high-resolution features
  on very-large area flexible substrates, while achieving precise registration of
  the antenna features over the entire substrate area. In this Phase II proposal we
  will develop and demonstrate processes to fabricate large-area antennas on flexible
  substrates, focusing, in particular, on JPL's 2 x 3 m active membrane phased array
  radar; and we will fabricate the flexible panels required for JPL's antenna. The
  fabrication of the array antenna will be performed using Anvik's novel large-area
  roll-to-roll photolithography technology, which enables high-resolution and micron-level
  registration on large-area flexible substrates.\",\n\t\"license_title\": \"U.S.
